var Webflow = Webflow || [];
Webflow.push(function(){
  const newsletterModal = Cookies.get('newsletterModal');
  if(!newsletterModal){
    $('.modal-wrapper').css('display', 'block');
    $('.modal-wrapper .close-link').click(function(){
      Cookies.set('newsletterModal', true, { expires: 7, path: '/' });
      $('.modal-wrapper').fadeOut();

      setTimeout(function(){
        $('.modal-wrapper').remove();
      }, 500);
    });

    $('.modal-wrapper a.button-popup').click(function(){
    	Cookies.set('newsletterModal', true, { expires: 7 });
      $('.modal-wrapper').fadeOut();

      setTimeout(function(){
        $('.modal-wrapper').remove();
      }, 500);
    });
  }
});

